import React from "react";
import classes from "./MessageItems.module.css"

const MessageItems = (props) => {
    return (
        <div className={classes.messages}>
            <div>
                {props.text}
            </div>

            <div className={classes.textarea}>
                <textarea></textarea>
            </div>
        </div>
    )
}

export default MessageItems
